import React from "react"

const Counter = () => {
    const count = 3;
    const formatCount = () => {
        return count === 0 ? "empty" : count;
    }
    return (
        <>
            <span className="badge bg-primary m-2">{formatCount()}</span>
            <button className="btn-primary">+</button>
        </>
    )
};

export default Counter;
